import React, { useState, useEffect } from "react";
import { useLocation, useParams } from "react-router-dom";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  ResponsiveContainer,
} from "recharts";
import {
  Table,
  TableHeader,
  TableColumn,
  TableBody,
  TableRow,
  TableCell,
} from "@nextui-org/react";

const Content = ({ marginTop = "20px" }) => {
  const location = useLocation();
  const [stockInfo, setStockInfo] = useState([]);
  const [historicalData, setHistoricalData] = useState([]); // For storing historical data
  const { ticker } = useParams();

  useEffect(() => {
    // Assuming you have a URL to fetch historical data for a specific stock
    if (ticker) {
      fetch(
        `https://mcsbt-integration-416413.lm.r.appspot.com/historical/${ticker}`
      )
        .then((response) => response.json())
        .then((data) => {
          // Format the data as needed by Recharts
          const formattedData = data.map((item) => ({
            date: item.date, // Assuming 'date' is part of your data
            price: item.close, // Assuming 'close' price is what you want to graph
          }));
          setHistoricalData(formattedData);
        })
        .catch((error) =>
          console.error("Failed to fetch historical data:", error)
        );
    }
  }, [ticker]); // Refetch when ticker changes

  const displayTicker = ticker ? ticker.toUpperCase() : "N/A";
  const isSummaryPage =
    location.pathname.includes("summary") || typeof ticker === "undefined";

  if (isSummaryPage) {
    return (
      <div
        style={{
          marginTop,
          width: "100%",
          maxWidth: "800px",
          textAlign: "center",
          color: "green", // Adjust the color for the summary page
          background: "black", // Light background color for contrast
          padding: "20px",
          borderRadius: "8px",
          boxShadow: "0 4px 14px 0 rgba(0,0,0,0.1)",
        }}
      >
        <h1>LISTOCK</h1>
      </div>
    );
  }

  return (
    <div style={{ marginTop, width: "100%", maxWidth: "800px" }}>
      <h2
        style={{
          color: "black",
          margin: "0 0 20px",
          fontWeight: "800",
          fontSize: "20px",
        }}
      >
        {displayTicker} ($)
      </h2>
      <Table aria-label="Stock">
        <TableHeader>
          <TableColumn width="30%">Date</TableColumn>
          <TableColumn width="30%">Open</TableColumn>
          <TableColumn width="30%">High</TableColumn>
          <TableColumn width="30%">Low</TableColumn>
          <TableColumn width="30%">Close</TableColumn>
          <TableColumn width="30%">Volume</TableColumn>
        </TableHeader>
        <TableBody>
          {stockInfo.map((info, index) => (
            <TableRow key={index}>
              <TableCell>{info.date}</TableCell>
              <TableCell>{info.open}</TableCell>
              <TableCell>{info.high}</TableCell>
              <TableCell>{info.low}</TableCell>
              <TableCell>{info.close}</TableCell>
              <TableCell>{info.volume}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
      {/* Add the chart for historical data */}
      <ResponsiveContainer width="100%" height={300}>
        <LineChart
          data={historicalData}
          margin={{ top: 5, right: 30, left: 20, bottom: 5 }}
        >
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="date" />
          <YAxis />
          <Tooltip />
          <Line type="monotone" dataKey="price" stroke="#8884d8" dot={false} />
        </LineChart>
      </ResponsiveContainer>
    </div>
  );
};

export default Content;
